<div class="container privacy-policy">
    <h1>Refund and Return policy</h1>
    <p>At Ramaeri, we are committed to providing you with the highest quality skincare products that nurture your skin and elevate your beauty routine. If, for any reason, you are not completely satisfied with your purchase, we are here to help.</p>

    <h2>Return Policy</h2>
    <p><strong>1. Eligibility:</strong> Products are eligible for return if they are unused, unopened, and in their original packaging. Returns must be initiated within 30 days of the delivery date.</p>
    <p><strong>2. Non-Returnable Items:</strong> Certain items, such as personalized or customized products, sale items, and gift cards, are not eligible for return.</p>
    <p><strong>3. Condition:</strong> Items returned must be in their original condition. We reserve the right to refuse returns that show signs of use, damage, or alteration.</p>

    <h2>Refund Process</h2>
    <p><strong>1. Refund Method:</strong> Refunds will be issued to the original payment method used during the purchase. Please note that shipping fees are non-refundable.</p>
    <p><strong>2. Processing Time:</strong> Once we receive your returned item, our team will inspect it. If the return is approved, we will process the refund within 7-10 business days.</p>
    <p><strong>3. Partial Refunds:</strong> In some cases, only partial refunds are granted (if applicable). This may include items that are not in their original condition or are missing parts for reasons not due to our error.</p>
    
    <h2>How to Initiate a Return</h2>
    <p><strong>1. Contact Us:</strong> Reach out to our customer support team at <strong><a  href="mailto:info@ramaeri.com">info@ramaeri.com</a></strong> within 30 days of receiving your order.</p>
    <p><strong>2. Provide Details:</strong> Include your order number, the items you wish to return, and the reason for the return.</p>
    <p><strong>3. Return Authorization:</strong> Our team will provide you with a Return Authorizatio n Number (RAN) and detailed instructions on how to return your item.</p>
    <p><strong>4. Ship Your Return:</strong> Please securely package your item, including the original packing slip, and ship it back to us using the carrier of your choice. We recommend using a trackable shipping service.</p>
    
    <h2>Exchanges</h2>
    <p><strong>1. Product Exchanges:</strong> If you wish to exchange an item, please follow the return process and place a new order for the desired product.</p>
    
    <h2>Damaged or Defective Products</h2>
    <p><strong>1. Report Issues:</strong> If you receive a damaged or defective product, please contact us immediately at <strong><a href="mailto:info@ramaeri.com">info@ramaeri.com</a></strong> with your order number and a photo of the damage or defect.</p>
    <p><strong>2. Replacement:</strong>  We will arrange for a replacement or refund, depending on your preference and product availability.</p>
    
    <h2>Contact Us</h2>
    <p>For any questions or concerns regarding your return or refund, please contact our customer support team at <strong><a  href="tel: +91 9244667631">(+91) -9244667631</a></strong> or <strong><a href="mailto:info@ramaeri.com">info@ramaeri.com</a></strong>. We are here to assist you!</p>
    <p>At Ramaeri, your satisfaction is our top priority. We are committed to ensuring a seamless and positive experience with our products and services.</p>
